$(document).ready(function(){$("#jobviteframe").css("display","block");var b=responsiveNav(".nav-collapse");var a=$(".hero").offset().top;$("body").scrollspy();$(window).scroll(function(){if($(window).scrollTop()>a){$(".header").addClass("has-bottom-border")}else{$(".header").removeClass("has-bottom-border")}});if($(".office-location-list").length){$(".office-location-list").mixitup({targetSelector:".office-item",effects:["fade"],easing:"cubic-bezier(0.075, 0.82, 0.165, 1)",transitionSpeed:800})}getCurrYear();updateImgs()});function getCurrYear(){var a=new Date().getFullYear();$(".copyright-year").text(a)}function updateImgs(a){var b=$("img[data-src]");b.each(function(){$(this).css("display","block");$(this).attr("src",$(this).attr("data-src"))})}function toggleNav(){$(".nav ul").slideToggle()}$(window).on("hashchange",function(){window.location.href=location.hash});function initializePreload(c){var a=0;var b=$(window).width();if(b>=500&&b<640){a=640}else{if(b>640&&b<=768){a=768}else{if(b>768&&b<=960){a=960}else{if(b>960&&b<=1024){a=1024}else{if(b>1024&&b<=1366){a=1366}else{if(b>1366){a=1920}else{a=500}}}}}}if(c=="index"){$.preloadImages("../imgs/austin-"+a+".jpg","../imgs/client-services-"+a+".jpg","../imgs/sales-"+a+".jpg","../imgs/human-resources-"+a+".jpg","../imgs/marketing-"+a+".jpg","../imgs/engineering-"+a+".jpg")}else{$.preloadImages("../imgs/home-"+a+".jpg","../imgs/departments-"+a+".jpg")}}$.preloadImages=function(){for(var a=0;a<arguments.length;a++){$("<img />").attr("src",arguments[a])}};